  // 处理form_data
  function formatData(item, type) {
    let data = supersetData[forecastMode][item.value][type][forecastType.value]
    data = JSON.parse(unescape(data))

    let newWhere = `forcast_day = ${days}`
    newWhere += ` and city = '${unescape(encodeURI(city))}' and station = '${unescape(encodeURI(station))}'`
    data.where = newWhere

    if (start && end) {
      data.since = `${start} 00:00:00`
      data.until = `${end} 00:00:00`
    }

    data = escape(JSON.stringify(data))

    return data
  }



